def are_parents(p1, p2, child):
    for i in range(len(child)):
        if (child[i] != p1[i]) and (child[i] != p2[i]):
            return (False)
    return (True)

def find_parents(data, i):
    x = 1
    while (x < len(data)):
        y = 1
        while (x != i) and (y < len(data) + 1):
            if (y != i) and (y != x):
                if (are_parents(data[x], data[y], data[i]) == True):
                    return [x, y]
            y += 1
        x += 1
    return [0, 0]

def find_ancestors(parents, i):
    list = parents[i]
    if list == [0, 0]:
        return []
    list.extend(find_ancestors(parents, parents[i][0]))
    list.extend(find_ancestors(parents, parents[i][1]))
    return list

def find_descendants(parents, i):
    list = []
    for a in parents:
        if i == parents[a][0] or i == parents[a][1]:
            list.append(a)
    return list

def assemble_family(scales, i):
    list = scales[i]
    a = 1
    while a <= len(scales):
        if a != i:
            for s in range(len(scales[i])):
                if scales[i][s] in scales[a]:
                    list += scales[a]
                    break
        a += 1
    return list

